const TvContainer = () => {

    const [tvs, setTVs] = useState ([])

    useEffect(() => {
        fetchTVs();
    },[])


    const fetchTvs = () => {
        fetch('http://localhost:8080/api/tvs')
        .then(response => response.json())
        .then(data => setTVs(data))
    }

    return (
        <h1> TV Container </h1>
    )
}
